import { useEffect, useState } from 'react';
import { buscarPratos } from '../services/pratosService';

function ListarPratos() {
  const [pratos, setPratos] = useState([]);

  useEffect(() => {
    buscarPratos().then(setPratos);
  }, []);

  return (
    <div>
      <h2>Lista de Pratos</h2>
      {pratos.map(prato => (
        <div key={prato.id}>
          <h3>{prato.nome}</h3>
          <p>{prato.descricao}</p>
          <p>R$ {prato.preco}</p>
          <img src={prato.urlImagem} alt={prato.nome} width={200} />
        </div>
      ))}
    </div>
  );
}

export default ListarPratos;
